import React from 'react';
import { useTranslation } from 'react-i18next';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faDownload, 
  faBirthdayCake, 
  faPhone, 
  faEnvelope, 
  faMapMarkerAlt, 
  faBriefcase 
} from '@fortawesome/free-solid-svg-icons';
import './About.css';

const About = () => {
  const { t } = useTranslation();

  // Animaciones
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        type: 'spring',
        stiffness: 100
      }
    }
  };

  return (
    <section id="sobre-mi" className="about-section">
      <div className="container">
        <motion.div
          className="section-title"
          initial={{ opacity: 0, y: -20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.2 }}
          transition={{ delay: 0.2 }}
        >
          <h2>{t('about.titulo')}</h2>
          <div className="underline"></div>
        </motion.div>

        <motion.div
          className="about-content"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true, amount: 0.2 }}
        >
          <motion.div className="about-text" variants={itemVariants}>
            <p>Soy un desarrollador web full-stack con más de 4 años de experiencia, especializado en Drupal, Angular y React. Mi trayectoria profesional me ha permitido trabajar en importantes proyectos para empresas como Consum, Ayuntamiento de Benidorm y HM Hospitales.</p>
            <p>Me apasiona crear soluciones web modernas, eficientes y con excelente experiencia de usuario. Mi enfoque se centra en aplicar las mejores prácticas de desarrollo y mantenerme actualizado con las últimas tecnologías y tendencias del sector.</p>
            <div className="cv-download">
              <a href="/assets/cv_DiegoMoreno.pdf" download className="download-btn">
                <FontAwesomeIcon icon={faDownload} /> {t('about.descargarCV')}
              </a>
            </div>
          </motion.div>

          <motion.div className="about-info" variants={itemVariants}>
            <h3>{t('about.datosPersonales')}</h3>
            <ul className="info-list">
              <li>
                <FontAwesomeIcon icon={faBirthdayCake} />
                <span className="info-title">{t('about.cumpleanos')}:</span>
                <span className="info-value">15/07/1999</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faPhone} />
                <span className="info-title">{t('about.telefono')}:</span>
                <span className="info-value">+34 662944881</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faEnvelope} />
                <span className="info-title">Email:</span>
                <span className="info-value">dmr13250@gmail.com</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faMapMarkerAlt} />
                <span className="info-title">{t('about.direccion')}:</span>
                <span className="info-value">Daimiel (Ciudad Real), España</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faBriefcase} />
                <span className="info-title">{t('about.cargo')}:</span>
                <span className="info-value">Desarrollador Web Full-Stack</span>
              </li>
            </ul>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
